import img1 from '../assets/img1.jpg';
import img3 from '../assets/img3.jpg';

function UserProfile() {
	return (
		<div className="m-auto w-8/12 ">
			<div className="bg-gray-400 m-2 rounded-lg">
				<div className="relative">
					<img src={img1} className="h-52 w-max rounded-t-lg object-cover object-center" />
				</div>
				<img src={img3} className="w-24 h-24 rounded-full object-cover object-center" />
			</div>
		</div>
	);
}

export default UserProfile;
